// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract TechOrganization is AccessControl {
    using EnumerableSet for EnumerableSet.AddressSet;

    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    enum OrgStatus { APPLY, PASS, REJECT }

    mapping (address => string) private _infomationURIs;
    // mapping (address => uint256) private _identityStatus;
    mapping (address => mapping (address => bool)) private _authorizeUsers;

    EnumerableSet.AddressSet private _applyList;
    EnumerableSet.AddressSet private _passList;

    event ApplyOrganization(uint256 totalApply, uint256 totalPass);

    constructor() {}

    function applyOrganization(string memory infomationURI) public {
        require(_applyList.contains(msg.sender), "APPLYED");
        require(_passList.contains(msg.sender), "AUTHENTICATED");

        _applyList.add(msg.sender);
        _infomationURIs[msg.sender] = infomationURI;

        emit ApplyOrganization(_applyList.length(), _passList.length());
    }

    function verifyApply(address organization, bool isPass) public {
        require(!_applyList.contains(organization), "NOT_FOUND");

        _applyList.remove(organization);
        if (isPass) _passList.add(organization);


    }
}
